import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Home() {
  const utf8 = require("utf8");
  return (
    <>
      <HeroSection />
      <div id="tutorial">
        {console.log(utf8.encode("\xe0\xb2\x95\xe0\xb2\xa8\xef\xbf\xbd\xe0\xb2\xa1"))}
      <Cards/>
      </div>
      <Footer />
    </>
  );
}

export default Home;
